import './App.css';

import React, { Component } from 'react'
import Navbar from './Components/Navbar';
import News from './Components/News';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

export default class App extends Component {
  render() {
    return (

     <div>
       <Router>
        <Navbar></Navbar>

       <Routes>


       <Route path='/' element = {<News key = "general" country = "us" pagesize = {9} Category ="general"></News>}>

        </Route>


       <Route path='/general' element = {<News  key = "general" country = "us" pagesize = {9} Category ="general"></News>}>

        </Route>

       <Route path="/business" element = { <News  key = "business" country = "us" pagesize = {9} Category ="business"></News>}>

       </Route>

       <Route path="/entertainment" element ={ <News  key = "entertainment" country = "us" pagesize = {9} Category ="entertainment"></News>}>
       </Route>

       <Route path="/health" element ={ <News   key = "health" pagesize = {9} country = "us" Category ="health"></News>}>

       </Route>

       <Route path="/sports" element ={<News  key = "sports" pagesize = {9} country = "us" Category ="sports"></News>}>

       </Route>

       <Route path="/science" element={ <News  key = "science" pagesize = {9} country = "us" Category ="science"></News>}>

       </Route>

       <Route path="/technology" element ={<News  key = "technology" pagesize = {9} country = "us" Category ="technology"></News>}>

       </Route>


     </Routes>

    </Router>


     </div>


    )
  }
}
